import React from 'react'
import Records from '../../content/JSON/Colors.json'

import '../PredefinedColors/PredefinedColors-style.scss'

export default function PredefinedColors() {
	
	return (
		<div className='predefined-main'>
			<h2>PredefinedColors</h2>
			{ Records.map( record => {
				return (
					<div>Name: {record.English} HEX: {record.HEX} RGB:</div>
				)
			}) }
		</div>
	)
}
